import React, {Component} from "react";
import {withRouter} from "react-router-dom";
class My extends Component {
    constructor() {
        super();
        this.state = {
            num:1
        }
    }
    add=()=>{
        this.props.history.push("/my")
    }
    render() {
        return ( <div className={"My"}>
            <img alt={"标本"} onClick={this.add} className={"addtoimg"} src={"https://image.hongbeibang.com/FrYeKj0MohOJQuNzUgCugg90cHCS?50X50&imageView2/1/w/50/h/50"} />
            <br/>
            <span>我</span>
        </div>)
    }
}

export default withRouter(My);
